import React from 'react';

const Form = ({ handleSubmit }) => {
  const handleFormSubmit = e => {
    e.preventDefault();
    handleSubmit();
  };
  return (
    <form className="form" onSubmit={handleFormSubmit}>
      <label>This is an example form, fill something in this field then submit</label>
      <input type="text" placeholder="some placeholder..." />
      <input type="submit" value="Submit to see a modal" />
    </form>
  );
};

export default Form;
